   // console.log(username);\n    this.userService.getNameOfUser(username).subscribe(\n      name => {\n        // console.log(name);\n        this.adminName = name;\n        console.log(this.adminName);\n      }\n    );\n  }\n\n  forAdmin()\n  {\n    this.userService.forAdmin().subscribe(\n      (response) => {\n        console.log(response);\n        this.message = response;\n      }\n    )\n  }\n\n  countStudent()\n  {\n    this.studentService.countStudent().subscribe(\n      (res2) => {\n        var count = Number(res2);\n        console.log(count);\n        this.studentCount = count;\n      }\n    )\n  }\n\n  countTeacher()\n  {\n    this.teacherService.countTeacher().subscribe(\n      (res2) => {\n        var count = Number(res2);\n        console.log(count);\n        this.teacherCount = count;\n      }\n    )\n  }\n\n  @ViewChild(MatSidenav)\n  sidenav!: MatSidenav;\n\n  ngAfterViewInit() {\n    this.observer\n      .observe(['(max-width: 800px)'])\n      .subscribe((res: any) => {\n        if (res.matches) {\n          this.sidenav.mode = 'over';\n          this.sidenav.close();\n        } else {\n          this.sidenav.mode = 'side';\n          this.sidenav.open();\n        }\n      });\n  }\n}\n\n\n\n    \n\n    \n        \n  \n     menu \n     close \n  \n  ADMIN DASHBOARD\n\n\n\n  \n    \n\n    {{this.adminName}}\n    Admin\n\n    \n\n    \n      home\n      Home\n    \n    \n      person\n      Profile\n    \n\n    \n\n    \n      \n          next_week\n        \n      Leave-List\n    \n\n    \n      message\n      Message-List\n     -->\n\n    \n      currency_rupee\n      Fee-List\n    \n\n\n  \n  \n    \n\n      \n        \n          \n            \n              \n                Total Teacher: {{teacherCount}}\n                {{countStu}} -->\n                Pending Students{{pendingstudentcount}} -->\n                Pending Teachers -->\n              \n            \n          \n\n          \n            \n              \n                Total 